import base64
import os
import shutil
import sys
from io import BytesIO

from PyQt5.QtCore import QPoint, Qt, QThread, pyqtSignal
from PyQt5.QtGui import QColor, QIcon, QPalette, QPixmap
from PyQt5.QtWidgets import (QApplication, QFileDialog, QLabel, QMessageBox,
                             QProgressBar, QPushButton, QTextEdit, QVBoxLayout,
                             QWidget)

# Base64 de la imagen del icono
ICON_BASE64 = b"""

"""

class BackupThread(QThread):
    update_progress = pyqtSignal(int)
    log_message = pyqtSignal(str)
    finished = pyqtSignal()

    def __init__(self, vst_paths, backup_dir):
        super().__init__()
        self.vst_paths = vst_paths
        self.backup_dir = backup_dir
        self.total_files = 0
        self.copied_files = 0
        self.cancelled = False
        self.errors = []

    def run(self):
        # Calcular el total de archivos a copiar
        for path in self.vst_paths:
            if os.path.exists(path):
                for root, _, files in os.walk(path):
                    self.total_files += len([file for file in files if file.endswith(('.dll', '.vst3'))])

        for path in self.vst_paths:
            if os.path.exists(path) and not self.cancelled:
                for root, _, files in os.walk(path):
                    for file in files:
                        if file.endswith(('.dll', '.vst3')):
                            architecture = "32_bit" if "Program Files (x86)" in root else "64_bit"
                            vst_type = "VST3" if file.endswith('.vst3') else "VST2"
                            subfolder = os.path.join(self.backup_dir, vst_type, architecture)

                            os.makedirs(subfolder, exist_ok=True)
                            src_file = os.path.join(root, file)
                            dest_file = os.path.join(subfolder, file)

                            # Copiar el archivo al directorio de backup solo si no existe
                            if not os.path.exists(dest_file):
                                try:
                                    shutil.copy2(src_file, dest_file)
                                    self.copied_files += 1
                                    self.log_message.emit(f"Copied: {file}")
                                except Exception as e:
                                    self.errors.append((file, str(e)))
                                    self.log_message.emit(f"Copy error {file}: {e}")
                            else:
                                self.log_message.emit(f"The file already exists: {file}")

                            # Actualizar progreso
                            self.update_progress.emit(int((self.copied_files / self.total_files) * 100))

        # Finalizar proceso y actualizar progreso a 100%
        self.update_progress.emit(100)
        self.finished.emit()

    def cancel(self):
        self.cancelled = True


class VSTBackup(QWidget):
    def __init__(self):
        super().__init__()
        self.initUI()
        self.drag_position = QPoint(0, 0)

    def initUI(self):
        self.setWindowTitle("VST-Backup")
        self.setGeometry(22, 120, 400, 450)

        # Decodificar Base64 y establecer el ícono
        icon_data = base64.b64decode(ICON_BASE64)
        pixmap = QPixmap()
        pixmap.loadFromData(icon_data)
        icon = QIcon(pixmap)
        self.setWindowIcon(icon)

        # Establecer que la ventana no tiene borde
        self.setWindowFlags(Qt.FramelessWindowHint)

        # Establecer un fondo gris con más transparencia
        self.setAttribute(Qt.WA_TranslucentBackground, True)
        palette = QPalette()
        palette.setColor(QPalette.Window, QColor(120, 120, 120, 150))  # Más transparencia
        self.setPalette(palette)

        layout = QVBoxLayout()
        layout.setContentsMargins(10, 40, 10, 10)  # Margen superior para botones

        # Crear barra de título personalizada
        title_bar = QWidget()
        title_bar_layout = QVBoxLayout()
        title_bar.setLayout(title_bar_layout)
        title_bar.setStyleSheet("background-color: rgb(128, 128, 128);")  # Barra gris
        layout.addWidget(title_bar)

        # Añadir el nombre del programa
        program_name = QLabel("VST-Backup")
        program_name.setStyleSheet("color: yellow; padding: 15px; font-size: 24px;")  # Texto amarillo
        title_bar_layout.addWidget(program_name)

        # Añadir un espacio entre el nombre y los botones
        title_bar_layout.addSpacing(10)  # Espacio de 10 píxeles

        # Botones de minimizar y cerrar
        self.close_button = QPushButton("EXIT")
        self.close_button.setStyleSheet("background-color: black; color: red; border: none; font-size: 18px; padding: 10px;")  # Agregar padding
        self.close_button.clicked.connect(self.close)

        self.minimize_button = QPushButton("MINIMIZE")
        self.minimize_button.setStyleSheet("background-color: black; color: yellow; border: none; font-size: 18px; padding: 10px;")  # Agregar padding
        self.minimize_button.clicked.connect(self.showMinimized)

        title_bar_layout.addWidget(self.close_button)
        title_bar_layout.addWidget(self.minimize_button)

        # Configurar marco amarillo más delgado a la derecha
        self.setStyleSheet("QWidget { border: 2px solid yellow; border-radius: 15px; background-color: black; color: yellow; }")

        # Mensaje inicial con rutas de búsqueda predeterminadas
        self.default_paths = "\n".join([  # Predeterminadas VST
            r"C:\Program Files (x86)\Audio Plugins",
            r"C:\Program Files\Audio Plugins",
            r"C:\Program Files (x86)\VSTPlugins",
            r"C:\Program Files\VSTPlugins",
            r"C:\Program Files\Steinberg\VSTPlugins",
            r"C:\Program Files (x86)\Steinberg\VSTPlugins",
            r"C:\Program Files\Common Files\VST3",
            r"C:\Program Files (x86)\Common Files\VST3"
        ])

        # Texto legible con fondo negro
        self.label = QLabel(f"Ready for VST plugin backup...\n\nDefault search paths:\n{self.default_paths}")
        self.label.setStyleSheet("color: yellow; background-color: black; padding: 8px;")  # Texto amarillo sobre fondo negro
        layout.addWidget(self.label)

        # Botón para seleccionar ruta de backup
        self.select_backup_button = QPushButton("Path where to save Backup")
        self.select_backup_button.setStyleSheet("background-color: black; color: white; font-size: 16px; padding: 15px;")  # Aumentar tamaño de texto y padding
        self.select_backup_button.clicked.connect(self.select_backup_directory)
        layout.addWidget(self.select_backup_button)

        # Botones de acción
        self.start_button = QPushButton("Start Backup")
        self.start_button.setStyleSheet("background-color: black; color: white; font-size: 16px; padding: 15px;")  # Aumentar tamaño de texto y padding
        self.start_button.clicked.connect(self.start_backup)
        layout.addWidget(self.start_button)

        self.cancel_button = QPushButton("Cancel Backup")
        self.cancel_button.setStyleSheet("background-color: black; color: white; font-size: 16px; padding: 15px;")  # Aumentar tamaño de texto y padding
        self.cancel_button.clicked.connect(self.cancel_backup)
        self.cancel_button.setEnabled(False)
        layout.addWidget(self.cancel_button)

        self.progress_bar = QProgressBar()
        self.progress_bar.setStyleSheet("QProgressBar { background-color: white; color: yellow; }")  # Barra de progreso con fondo negro y texto amarillo
        layout.addWidget(self.progress_bar)

        self.log_text = QTextEdit()
        self.log_text.setReadOnly(True)
        self.log_text.setStyleSheet("background-color: black; color: yellow;")  # Fondo negro y texto amarillo
        layout.addWidget(self.log_text)

        # Botón para seleccionar ruta alterna de VST
        self.select_vst_button = QPushButton("Select Alternate VST Path")
        self.select_vst_button.setStyleSheet("background-color: black; color: white; font-size: 16px; padding: 15px;")  # Aumentar tamaño de texto y padding
        self.select_vst_button.clicked.connect(self.select_vst_directory)
        layout.addWidget(self.select_vst_button)

        self.setLayout(layout)

        # Rutas de plugins VST predeterminadas
        self.vst_paths = [
            r"C:\Program Files (x86)\Audio Plugins",
            r"C:\Program Files\Audio Plugins",
            r"C:\Program Files (x86)\VSTPlugins",
            r"C:\Program Files\VSTPlugins",
            r"C:\Program Files\Steinberg\VSTPlugins",
            r"C:\Program Files (x86)\Steinberg\VSTPlugins",
            r"C:\Program Files\Common Files\VST3",
            r"C:\Program Files (x86)\Common Files\VST3"
        ]

        self.backup_directory = None  # Inicialmente sin ruta de backup

    def select_backup_directory(self):
        # Seleccionar el directorio de backup
        backup_directory = QFileDialog.getExistingDirectory(self, "Select Backup Path")
        if backup_directory:
            self.backup_directory = backup_directory  # Asignar la ruta seleccionada
            self.log_text.append(f"Selected backup path: {self.backup_directory}")
            self.start_button.setEnabled(True)  # Habilitar botón de inicio de backup
            self.cancel_button.setEnabled(False)  # Asegurar que el botón de cancelar esté deshabilitado

    def select_vst_directory(self):
        # Seleccionar ruta alternativa de VST
        vst_directory = QFileDialog.getExistingDirectory(self, "Select Alternate VST Path")
        if vst_directory and vst_directory not in self.vst_paths:
            self.vst_paths.append(vst_directory)  # Agregar nueva ruta de VST
            self.log_text.append(f"VST route added: {vst_directory}")

    def start_backup(self):
        if not self.backup_directory:  # Verificar que haya una ruta de backup seleccionada
            QMessageBox.warning(self, "Warning", "Please select a backup path first.")
            return

        self.log_text.clear()
        self.progress_bar.setValue(0)
        self.backup_thread = BackupThread(self.vst_paths, self.backup_directory)
        self.backup_thread.update_progress.connect(self.progress_bar.setValue)
        self.backup_thread.log_message.connect(self.log_text.append)
        self.backup_thread.finished.connect(self.backup_finished)

        self.backup_thread.start()
        self.start_button.setEnabled(False)  # Deshabilitar botón de inicio
        self.cancel_button.setEnabled(True)  # Habilitar botón de cancelar

    def cancel_backup(self):
        if hasattr(self, 'backup_thread'):
            self.backup_thread.cancel()
            self.log_text.append("Backup canceled.")
            self.progress_bar.setValue(0)
            self.cancel_button.setEnabled(False)  # Deshabilitar botón de cancelar
            self.start_button.setEnabled(True)  # Habilitar botón de inicio

    def backup_finished(self):
        self.log_text.append("Backup completed.")
        self.cancel_button.setEnabled(False)  # Deshabilitar botón de cancelar

    def mousePressEvent(self, event):
        if event.button() == Qt.LeftButton:
            self.drag_position = event.globalPos() - self.frameGeometry().topLeft()
            event.accept()

    def mouseMoveEvent(self, event):
        if event.buttons() == Qt.LeftButton:
            self.move(event.globalPos() - self.drag_position)
            event.accept()


if __name__ == '__main__':
    app = QApplication(sys.argv)
    backup_app = VSTBackup()
    backup_app.show()
    sys.exit(app.exec_())
